export default function Leftcategory() {

    const [category, setCategory] = useState([]);

    useEffect(() => {
     
        fetch('https://fakestoreapi.com/products/categories');

        then(response => response.json())
        then(data => {
            setCategory(data)
        })

    }, [])

  return (
            <div>
                <h2>Category</h2>

            </div>

  )
}
